import icon_brand from './images/icon-brand-recognition.svg';

const SectionOne = () => {
    return ( 
        <section className=" bg-gray mt-28 relative">
            <FormLink />
            <h2 className="">
                Advanced Statistics
            </h2>
            <p>
                Track how your links are performing across the web with our advanced statistics dashboard.
            </p>
            <div>
                <img src={icon_brand} alt="icon-brand" />
                <h3>Brand Recognition</h3>
                <p>
                    Boost your brand recognition with each click. Generic links don't mean a thing
                </p>       
            </div>
        </section>
    );
}

export default SectionOne;
